import React from 'react';
import stationData from '../server/stationData';
import './NavBar.css';

export default function NavBar(props) {
    const { color } = props;
    const specificStations = stationData[color.toLowerCase()];
    console.log(specificStations);

    return (
        <div className="navBar">
            <p id="navDesc">Select your starting station</p>
            <div className="listContainer">
                <div id="all">All Stations</div>
                <div id="stations">{specificStations.map((station) => (<p id="station">{station}</p>))}</div>
            </div>
        </div>
    );
}
